import React, {useState} from "react";



const Modal = ({active, setActive}) => {
  return(
    <div className={active ? "modal active" : "modal"} onClick={() => setActive(false)}>
      <form className="modalContent" onClick={(e) => e.stopPropagation()}>
          <input type="text" />
      </form>
    </div>
  )
}

export default Modal;
